import React from 'react';
import { useForm } from 'react-hook-form';
import { useNavigate } from 'react-router-dom'; 
import * as Yup from 'yup'; 
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { yupResolver } from '@hookform/resolvers/yup'; 
import '../User/Usercss/User.css'
import { userLogin } from '../services/index'; 
import { RiAdminFill } from "react-icons/ri";
const schema = Yup.object().shape({
  email: Yup.string().required("Password is required"), 
  password: Yup.string().required("Password is required")
});

export default function UserLogin() {
  const navigate = useNavigate();

  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm({
    resolver: yupResolver(schema) 
  });

  const onSubmit = async (data) => {
    try {
      const result = await userLogin(data);
      if (result.status === true && result.code === 200) {
        toast.success(result.message);
        window.localStorage.setItem("token", JSON.stringify(result.data));
        window.localStorage.setItem("userType", JSON.stringify("user"));
        navigate('/user/product-list');  
      } else {
        toast.error(result.message || "Login failed. Please try again."); 
      }
    } catch (err) {
      console.error(err);
    }
  };
  

  return (
    <div className="container-fluid">
      <div className="row py-3 a1" style={{ background: "#e0f7fa", minHeight: '700px' }}>
        <div className="col-sm-2"></div>
        <div className="col-sm-4 b1 my-4">
          <center> <h1 style={{ color: '#00796b' }} className="my-4">
           <RiAdminFill/>   User<span style={{ color: 'black' }}>Login</span>
            </h1>  <form onSubmit={handleSubmit(onSubmit)}> 
              <div className="form-group">
                <input
                  type="text"
                  className={`form-control w-100 ${errors.email ? 'is-invalid' : ''}`} 
                  placeholder="Enter Your Email or Contact."
                  {...register("email")} 
                />
                {/* {errors.email && <div className="invalid-feedback">{errors.email.message}</div>}  */}
              </div>
              <br />
              <div className="form-group">
                <input
                  type="password"
                  className={`form-control w-100 ${errors.password ? 'is-invalid' : ''}`} 
                  placeholder="Enter Your Password"
                  {...register("password")} 
                />
                {/* {errors.password && <div className="invalid-feedback">{errors.password.message}</div>}  */}
              </div>
              <br />
              <div>
                <button
                  className="form-control w-100"
                  style={{ background: '#00796b', color: 'white' }}
                  type="submit" 
                >
                  Login
                </button>
              </div>
              <br />
              <h5 className="text-light">
                <b style={{color:'#00796b'}}>Don't have an account? </b><a href="/user/register">Sign Up Here</a>
              </h5>
            </form>
          </center>
        </div>
        <div className="col-sm-4">
           <div className="row">
            <div className="col-sm-2"></div>
            <div className="col-sm-4">
            <img  alt='no'
            src="data:image/png;base64,"
              //src="data:image/png;base64,"
             style={{height:'400px'}}/>
            </div>
            <div className="col-sm-6"></div>
           </div>
          </div>
        <div className="col-sm-2"></div>
      </div>
      <ToastContainer />
    </div>
  );
}
